import React from 'react'
import Link from 'next/link';
import styled from 'styled-components';

export const Nav = styled.nav`
    background: #e2e2e2;
    height: 80px;

`

export const NavbarContainer = styled.div`
    display: flex;
    justify-content: space-between;
    height: 80px;

    width: 100%;
`

export const Logo = styled.div`
    // background-image: url('../../image/bdot_logo.png');
    background-image: url('https://i.pinimg.com/236x/05/52/37/055237cde9e33fc7b4e4146289731648.jpg');

`

export const NavMenu = styled.ul`
    display: flex;
    align-items: center;
    list-style: none;
    list-style: none;
    text-align: center;
    margin-right: -22px;
`

export const NavItem = styled.li`
    height: 80px;
` 
const Navbar = () => {
    return (
        <>
            <Nav>
                <NavbarContainer>
                    <Link href="/" src="https://i.pinimg.com/236x/05/52/37/055237cde9e33fc7b4e4146289731648.jpg">
                        <a>로고</a>
                        {/* <Logo/> */}
                    </Link>

                    <NavMenu>
                        <NavItem>
                            홈
                        </NavItem>

                        <NavItem>
                            닷비디오
                        </NavItem>

                        <NavItem>
                            팔로우
                        </NavItem>
                    </NavMenu>
                </NavbarContainer>
            </Nav>
        </>
    )
}

export default Navbar
